import React from 'react';

function Resume() {
    return (
        <div className="card">
            <h3>Resume in progress...</h3>
            <img src={require("../../resume/")} className="card-img-top w-50 mx-auto" alt="FH resume" />
        </div>
    )
}
export default Resume;
